import React from "react";

const products = [
  { id: 0, title: "Bread" },
  { id: 1, title: "Milk" },
  { id: 2, title: "Cheese" },
  { id: 3, title: "Water" },
];

function App() {
  return (
    <div>
      <ul>
        {products.map((product) => (
          <li key={product.id}>{product.title}</li>
        ))}
      </ul>
    </div>
  );
}

export default App;
